import React from 'react';
import {Routes, Route, Navigate, BrowserRouter} from 'react-router-dom'
import {authRoutes, publicRoutes} from "../routes";

const AppRouter = () => {
    const isAuth = false
    return (
        <BrowserRouter><Routes>
            {isAuth === true && authRoutes.map(({path, Components}) =>(<Route key={path} path={path} component={<Components />}/>))}
            {publicRoutes.map(({path, Components}) =>(<Route key={path} path={path} component={<Components />}/>))}
        </Routes>
        </BrowserRouter>
    );
};

export default AppRouter;
